import base64
import time
import requests
from Crypto.Cipher import AES
from Crypto.Util.Padding import pad


def aes_ecb_encrypt_text(decrypt_text: str) -> str:
    """
    加密AES_ECB明文
    :param decrypt_text: 待加密的字符串
    :param key: 密钥
    :return:  加密后的数据
    """
    key_str = "wdf2ff*TG@*(F4)*YH)g430HWR(*)wse"
    aes2 = AES.new(key_str.encode('utf-8'), AES.MODE_ECB)
    encrypt_text = aes2.encrypt(pad(decrypt_text.encode('utf-8'), AES.block_size, style='pkcs7'))
    encrypt_text = str(base64.encodebytes(encrypt_text), encoding='utf-8').replace("\n", "")
    return encrypt_text


def total_number(page):
    headers = {
        'authority': 'www.python-spider.com',
        'pragma': 'no-cache',
        'cache-control': 'no-cache',
        'sec-ch-ua': '" Not A;Brand";v="99", "Chromium";v="96", "Google Chrome";v="96"',
        'accept': 'application/json, text/javascript, */*; q=0.01',
        'content-type': 'application/x-www-form-urlencoded; charset=UTF-8',
        'x-requested-with': 'XMLHttpRequest',
        'sec-ch-ua-mobile': '?0',
        'user-agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.110 Safari/537.36',
        'sec-ch-ua-platform': '"Windows"',
        'origin': 'https://www.python-spider.com',
        'sec-fetch-site': 'same-origin',
        'sec-fetch-mode': 'cors',
        'sec-fetch-dest': 'empty',
        'referer': 'https://www.python-spider.com/challenge/14',
        'accept-language': 'zh-CN,zh;q=0.9,en;q=0.8',
        'cookie': 'Hm_lvt_337e99a01a907a08d00bed4a1a52e35d=1637918105,1638761279,1639967780; sign=1639988233~YWlkaW5nX3dpbjE2Mzk5ODgyMzI2NDE=|c6daf96c23e1bd641333d2b28f4eb02a; sessionid=2fgngvvf6a66ip0evky0xusb6d4csg8d; __jsl_clearance=1640060344.976|0|clD4VpfqhdaLBWywKWy%2FZyfi6d_1fa8bad0dcb6120e49a84883c24585033D; Hm_lpvt_337e99a01a907a08d00bed4a1a52e35d=1640074895',
    }

    decrypt_str = str(int(time.time())) + '|' + str(page)
    uc = aes_ecb_encrypt_text(decrypt_str)
    print("加密后的文本:", uc)
    data = {
        'page': page,
        'uc': uc
    }

    response = requests.post('https://www.python-spider.com/api/challenge14', headers=headers, data=data).json()
    data = response["data"]
    page_num = 0
    for i in data:
        num = i.get("value").replace('\r','')
        page_num += int(num)
        print(f'num :{num}')
    return page_num
if __name__ == '__main__':
    all_num = 0
    for i in range(1, 101):
        resp = total_number(page=i)
        all_num += resp
    print(f'累加的总和为： {all_num}')
